import styled from "styled-components";

export const Botones = styled.button `
      border:0px;
      background-color: rgb(198, 15, 15);
      width: fit-content;
      height: fit-content;
      border-radius: 15px;
      transition: 0.5s;    
      color: white
`;

export const DivCard = styled.div `
      background-color:#a2c11c;
      width: fit-content;
      padding: 1em;
      border-radius: 10px;
      box-shadow: 10px 10px 5px 0px rgba(0,0,0,0.75);
      text-shadow: 6px 4px 7px rgba(0,0,0,0.6);
      display: flex;
      flex-direction: column;
`;  

export const Titulos = styled.h2 `  
`;

export const Imagenes = styled.img `
`;

function Card(props) {
   return (
      <DivCard>
         <Botones onClick={props.onClose}>X</Botones>
         <Titulos>{props.name}</Titulos>
         <Titulos>{props.species}</Titulos>
         <Titulos>{props.gender}</Titulos>
         <Imagenes  src={props.image} alt={''} />
      </DivCard>
   );
}
export default Card;
